  \"2015-09-26T23:47:41.317749\",\n\t\"name\": \"u-s-annual-seasonal-climate-normals-1981-2010\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The U.S. Annual Climate Normals for 1981
  to 2010 are 30-year averages of meteorological parameters that provide users with
  many tools to understand typical climate conditions for thousands of locations across
  the United States, as well as U.S. territories, commonwealths, the Compact of Free
  Association nations, and one station in Canada. As many NWS stations as possible
  are used, including those from the NWS Cooperative Observer Program (COOP) Network
  as well as some additional stations that have a Weather Bureau Army-Navy (WBAN)
  station identification number, including stations from the Climate Reference Network
  (CRN). THe Annual Climate Normals dataset includes various derived products such
  as daily air temperature normals (including maximum and minimum temperature normal,
  heating and cooling degree day normal, and others), precipitation normals (including
  snowfall and snow depth, percentiles, frequencies and other), and hourly normals
  (all normal derived from hourly data including temperature, dew point, heat index,
  wind chill, wind, cloudiness, heating and cooling degree hours, pressure normals).
  All data utilized in the computation of the 1981-2010 Climate Normals were taken
  from the ISD Lite (a subset of derived Integrated Surface Data), the Global Historical
  Climatology Network-Daily dataset, and standardized monthly temperature data (COOP).
  These source datasets (including intermediate datasets used in the computation of
  products) are also archived at the NOAA NCDC.\",\n\t\"license_title\": null,\n\t\"extras\":
